import React from 'react';
import { AutoLinkHeader, Example, Link as PatternflyThemeLink } from 'theme-patternfly-org/components';
import '../../../../node_modules/@patternfly/react-core/src/layouts/Flex/examples/./flex.css';
const pageData = {
  "id": "Flex",
  "section": "layouts",
  "source": "react",
  "slug": "/layouts/flex/react",
  "sourceLink": "https://github.com/patternfly/patternfly-react/blob/main/packages/docs/packages/react-core/src/layouts/Flex/examples/Flex.md",
  "propComponents": [
    {
      "name": "Flex",
      "description": "",
      "props": [
        {
          "name": "align",
          "type": "{
  default?: 'alignLeft' | 'alignRight';
  sm?: 'alignLeft' | 'alignRight';
  md?: 'alignLeft' | 'alignRight';
  lg?: 'alignLeft' | 'alignRight';
  xl?: 'alignLeft' | 'alignRight';
  '2xl'?: 'alignLeft' | 'alignRight';
}",
          "description": "Value to use for margin: auto at various breakpoints"
        },
        {
          "name": "alignContent",
          "type": "{
  default?:
    | 'alignContentFlexStart'
    | 'alignContentFlexEnd'
    | 'alignContentCenter'
    | 'alignContentStretch'
    | 'alignContentSpaceBetween'
    | 'alignContentSpaceAround';
  sm?:
    | 'alignContentFlexStart'
    | 'alignContentFlexEnd'
    | 'alignContentCenter'
    | 'alignContentStretch'
    | 'alignContentSpaceBetween'
    | 'alignContentSpaceAround';
  md?:
    | 'alignContentFlexStart'
    | 'alignContentFlexEnd'
    | 'alignContentCenter'
    | 'alignContentStretch'
    | 'alignContentSpaceBetween'
    | 'alignContentSpaceAround';
  lg?:
    | 'alignContentFlexStart'
    | 'alignContentFlexEnd'
    | 'alignContentCenter'
    | 'alignContentStretch'
    | 'alignContentSpaceBetween'
    | 'alignContentSpaceAround';
  xl?:
    | 'alignContentFlexStart'
    | 'alignContentFlexEnd'
    | 'alignContentCenter'
    | 'alignContentStretch'
    | 'alignContentSpaceBetween'
    | 'alignContentSpaceAround';
  '2xl'?:
    | 'alignContentFlexStart'
    | 'alignContentFlexEnd'
    | 'alignContentCenter'
    | 'alignContentStretch'
    | 'alignContentSpaceBetween'
    | 'alignContentSpaceAround';
}",
          "description": "Value to add for align-content property at various breakpoints"
        },
        {
          "name": "alignItems",
          "type": "{
  default?:
    | 'alignItemsFlexStart'
    | 'alignItemsFlexEnd'
    | 'alignItemsCenter'
    | 'alignItemsStretch'
